import OpeningFileIcon from './Icons/OpeningFileIcon.js';
import ResumeFileIcon from './Icons/ResumeFileIcon.js';

function IconColumn() {
    return (
        <div className="flex flex-col w-32 pt-20">
            <OpeningFileIcon />
            <ResumeFileIcon />
        </div>
    )
}

export default IconColumn;
